// Create some test objects for runtime completion
const myObject = {
  name: 'Test Object',
  getValue: () => 42,
  data: [1, 2, 3],
  nested: {
    property: 'nested value'
  }
};

const myArray = [1, 2, 3, 4, 5];

exports.myObject = myObject;
exports.myArray = myArray;

console.log('Objects created for runtime completion testing');

// Try typing 'myObject.' to see runtime completions
